import{_ as i,o as t,c as a,N as r}from"./chunks/framework.c240b1e9.js";const h=JSON.parse('{"title":"Yfirlit yfir útgefin skírteini","description":"","frontmatter":{},"headers":[],"relativePath":"skirteini/yfirlit.md","lastUpdated":null}'),e={name:"skirteini/yfirlit.md"},n=r('<h1 id="yfirlit-yfir-utgefin-skirteini" tabindex="-1">Yfirlit yfir útgefin skírteini <a class="header-anchor" href="#yfirlit-yfir-utgefin-skirteini" aria-label="Permalink to &quot;Yfirlit yfir útgefin skírteini&quot;">​</a></h1><p>Hægt er að sjá yfirlit yfir öll skírteini sem gefin hafa verið út fyrir viðkomandi skip. Þetta er yfirlit yfir þau “Nauðsynlegu” skírteini sem skipið er með í dag, óháð því hvort skírteini sé í gildi eða runnið úr gildi.</p><h2 id="litakoðar-skirteina" tabindex="-1">Litakóðar skírteina <a class="header-anchor" href="#litakoðar-skirteina" aria-label="Permalink to &quot;Litakóðar skírteina&quot;">​</a></h2><h2 id="utprentun-skirteina" tabindex="-1">Útprentun skírteina <a class="header-anchor" href="#utprentun-skirteina" aria-label="Permalink to &quot;Útprentun skírteina&quot;">​</a></h2><p>Ef prenta þarf skírteini er smellt á táknið og birtist þá listi af sniðmáti skírteinis sem hlaðið er niður og prentað fyrir hefðbundna útgáfu skírteina. Sjá nánar - 3.6 rafræn útgáfa skírteinis. <strong>Aðeins starfsmenn Samgöngustofu geta framkvæmt þessa aðgerð.</strong> Í sumum tilvikum eru til fleiri en ein útgáfa (sniðmát) af umræddu skírteini (t.d. farþegaleyfi) og er þá hægt að velja útgáfuna sem prenta á úr valmyndinni.</p><h2 id="utgafusaga-skirteinis" tabindex="-1">Útgáfusaga skírteinis <a class="header-anchor" href="#utgafusaga-skirteinis" aria-label="Permalink to &quot;Útgáfusaga skírteinis&quot;">​</a></h2><p>Til að nálgast upplýsingar um eldri útgáfur skírteinis er smellt á söguhnappinn og birtast þá allar sögufærslur.</p><h2 id="framlenging-skirteina" tabindex="-1">Framlenging skírteina <a class="header-anchor" href="#framlenging-skirteina" aria-label="Permalink to &quot;Framlenging skírteina&quot;">​</a></h2><p>Í sumum tilvikum er hægt að framlengja skírteini skips. Líkt og með útgáfu skips skírteina þá getur aðeins Samgöngustofa framlengt skírteini.</p>',9),s=[n];function l(f,u,g,k,o,m){return t(),a("div",null,s)}const p=i(e,[["render",l]]);export{h as __pageData,p as default};
